import React, { Component } from "react";
import {MDBFooter, MDBNavbar, MDBNavbarBrand, MDBNavbarNav, MDBNavbarToggler, MDBCollapse, MDBNavItem, MDBNavLink, MDBIcon,} from 'mdbreact';

import { BrowserRouter as Router } from "react-router-dom";
import Routes from "./Routes";

class App extends Component {
  state = {
    collapseID: ""

  };

  toggleCollapse = collapseID => () =>
    this.setState(prevState => ({
      collapseID: prevState.collapseID !== collapseID ? collapseID : ""
    }));

  closeCollapse = collapseID => () => {
    window.scrollTo(0, 0);
    this.state.collapseID === collapseID && this.setState({ collapseID: "" });
  };


  render() {
    const container = { height: 1300 }

    return (
      <Router>
        <div className="flyout" style={{backgroundColor:"#fff"}}>


          <MDBNavbar style={{paddingTop:"1px",paddingBottom: "1px",}}color="00695c" dark expand="md" fixed="top" scrolling>
            <MDBNavbarBrand href="/" style={{color:"black",paddingTop:"5px",paddingBottom: "5px",}}>
              <img src={require('./assets/lg.png')} style={{ height: "", width: "3.7rem",marginBottom: "-22px",marginRight:"12px",boxShadow:"rgb(249, 247, 247) 0px 1px 0px 0px, rgb(253, 251, 251) 0px 3px 0px 0px",borderRadius:"50%" }}/>cladi

            </MDBNavbarBrand>
            <MDBNavbarToggler
            className="black" 
              onClick={this.toggleCollapse("mainNavbarCollapse")}
            />
            <MDBCollapse
              id="mainNavbarCollapse"
              isOpen={this.state.collapseID}
              navbar
              className="dark-grey-text"
            >
                <MDBNavbarNav left>
                  <MDBNavItem active>
                    <MDBNavLink    exact className="dark-grey-text" to="/">Home</MDBNavLink>
                  </MDBNavItem>
                  <MDBNavItem>
                    <MDBNavLink    exact className="dark-grey-text"  to="/grid">grid</MDBNavLink>
                  </MDBNavItem>
                  <MDBNavItem>
                    <MDBNavLink exact className="dark-grey-text"  to="/geo">geo</MDBNavLink>
                  </MDBNavItem>
                  <MDBNavItem>
                    <MDBNavLink exact className="dark-grey-text"  to="/product">product</MDBNavLink>
                  </MDBNavItem>
                </MDBNavbarNav>
                <MDBNavbarNav right>
                  <MDBNavItem>
                    <MDBNavLink to="#"><MDBIcon fab icon="facebook-f" /></MDBNavLink>
                  </MDBNavItem>
                  <MDBNavItem>
                    <MDBNavLink to="#"><MDBIcon fab icon="twitter" /></MDBNavLink>
                  </MDBNavItem>
                  <MDBNavItem>
                    <MDBNavLink to="#"><MDBIcon fab icon="instagram" /></MDBNavLink>
                  </MDBNavItem>
                </MDBNavbarNav>
              </MDBCollapse>
            </MDBNavbar>


        <div style={{ marginTop:"505px",marginTop: "3.5rem" }}>
        <main >
            <Routes />
          </main>
          </div>
          <MDBFooter color="" style={{backgroundColor:"#213357",zIndex: "",}}>
            <p className="footer-copyright mb-0 py-3 text-center">
              &copy; {new Date().getFullYear()} Copyright:{" "}
              <a href="https://www.MDBootstrap.com"> cladi.com </a>
            </p>
          </MDBFooter>
        </div>
      </Router>
    );
  }
}

export default App;
